import React from "react";
import {
  Nav,
  NavbarContainer,
  NavLogo,
  NavIcon,
  Btn_Signin,
  Btn_Login,
  Buttons,
} from "./NavbarElement";
import Logo from "../../assets/g853.png";
export const Navbar = () => {
  return (
    <Nav>
      <NavbarContainer>
        <NavLogo to="./">
          <NavIcon src={Logo} />
        </NavLogo>
        <Buttons>
          <Btn_Signin to="/Signin">Sign In</Btn_Signin>
          <Btn_Login to="/Login">Log In</Btn_Login>
        </Buttons>
      </NavbarContainer>
    </Nav>
  );
};
export default Navbar;
